//Change these values to represent good and great scores in stats. (CHANGING THESE VALUES WILL NOT RESET SCORES OR BACKTRACK GUESSES. IF YOU CHANGE WHILE HAVING E.G. 5 GOOD GUESSES ALREADY, IT WILL CONTINUE COUNTING FROM 5.)
let custom_near5k = 4900;
let custom_goodscore = 4500;





//************************************************************* START OF SCRIPT *************************************************************//

//GLOBAL VARIABLES

//Get User ID
