//Check the country code
function checkGuessCountryCode(out) {
    //console.log(out);
    let countryCode = 'NO CODE';
    if (out.address['ISO3166-2-lvl4']){
        //console.log("isolvl4 detected");
        if (["bg", "de", "es", "au", "us", "ru", "za", "id", "ar", "in", "cl", "ca", "mx", "br", "nz", "my", "no", "jp", "nl", "bo", "gb", "pe", "kz"].includes(out.address.country_code)){
            //console.log("isolvl4 confirmed for country");
            countryCode = out.address['ISO3166-2-lvl4'];
        }
        //Exceptions for when the api does not return a state
    } else if (out.address.country_code === "mx"){
        if (stateOfMexico.includes(out.address.county) || (out.address.postcode > 50000 && out.address.postcode < 58000)){
            countryCode = "MX-MEX";
        } else if (out.address.postcode < 17000 || out.address.city === "Mexico City"){
            countryCode = "MX-CMX";
        }
    } else if (out.address.country_code === "es"){
        if (out.address.postcode >= 30000 && out.address.postcode < 31000){
            countryCode = "ES-MU";
        } else if ((out.address.postcode >= 8000 && out.address.postcode < 9000) || (out.address.postcode >= 17000 && out.address.postcode < 18000) || (out.address.postcode >= 25000 && out.address.postcode < 26000) || (out.address.postcode >= 43000 && out.address.postcode < 44000)){
            countryCode = "ES-CT";
        } else if (out.address.postcode >= 31000 && out.address.postcode < 32000) {
            countryCode = "ES-NA";
        } else {
            if (out.address.town) {
                if(murciaMunicipalities.includes(out.address.town)){
                    countryCode = "ES-MU";
                }
            }
            if (out.address.village){
                if(murciaMunicipalities.includes(out.address.village)){
                    countryCode = "ES-MU";
                }
            }
        }
    } else if (out.address.country_code === "my"){
        if (selangorDistricts.includes(out.address.district) || out.address.city === "Sepang") {
            countryCode = "MY-10";
        }
    }

    if (countryCode === "NO CODE") {
        console.log(out);
    }
    //console.log(countryCode);
    return countryCode;
}


function checkGuessIslandCode(out) {
    //console.log(out);
    let countryCode = 'NO CODE';
    if (out.address.country_code === 'id' && out.address['ISO3166-2-lvl3']){
        //console.log("isolvl3 detected");
        if (["id"].includes(out.address.country_code)){
            //console.log("isolvl3 confirmed for country");
            countryCode = out.address['ISO3166-2-lvl3'];
        }
    } else if (out.address.country_code === 'nz') {
        if (out.address['ISO3166-2-lvl4']) {
            if(["NZ-NTL", "NZ-AUK", "NZ-WKO", "NZ-BOP", "NZ-GIS", "NZ-HKB", "NZ-TKI", "NZ-MWT", "NZ-WGN"].includes(out.address['ISO3166-2-lvl4'])) {
                countryCode = "NZ-NI";
            } else if (["NZ-CIT"].includes(out.address['ISO3166-2-lvl4'])){
                countryCode = "NZ-CI";
            } else if (["NZ-WTC", "NZ-CAN", "NZ-OTA", "NZ-STL", "NZ-TAS", "NZ-NSN", "NZ-MBH"].includes(out.address['ISO3166-2-lvl4'])){
                countryCode = "NZ-SI";
            }
        }
    } else if (out.address.country_code === "my") {
        if (out.address['ISO3166-2-lvl4']) {
            if(["MY-02", "MY-03", "MY-08", "MY-09", "MY-07", "MY-10", "MY-05", "MY-04", "MY-01", "MY-06", "MY-11", "MY-14", "MY-16"].includes(out.address['ISO3166-2-lvl4'])) {
                countryCode = "MY-MAIN";
            } else if (["MY-12", "MY-13", "MY-15"].includes(out.address['ISO3166-2-lvl4'])){
                countryCode = "MY-BR";
            }
        }
    } else if (out.address.country_code === "ru") {
        if (out.address['region']) {
            if (out.address['region'] === "Ural Federal District") {
                countryCode = "RU-URAL";
            } else if (out.address['region'] === "North Caucasian Federal District") {
                countryCode = "RU-NORTHCAUCASIAN";
            } else if (out.address['region'] === "Southern Federal District") {
                countryCode = "RU-SOUTHERN";
            } else if (out.address['region'] === "Northwestern Federal District") {
                countryCode = "RU-NORTHWESTERN";
            } else if (out.address['region'] === "Volga Federal District") {
                countryCode = "RU-VOLGA";
            } else if (out.address['region'] === "Siberian Federal District") {
                countryCode = "RU-SIBERIAN";
            } else if (out.address['region'] === "Far Eastern Federal District") {
                countryCode = "RU-FAREASTERN";
            } else if (out.address['region'] === "Central Federal District") {
                countryCode = "RU-CENTRAL";
            }
        }
    }
    //console.log(countryCode);
    return countryCode;
}




//Get the guess country code
async function getGuessCountryCode(location, islandMode) {
    //console.log(location);
    if (location[0] <= -85.05 || location == null) {
        return 'AQ';
    } else {
        let api = "https://nominatim.openstreetmap.org/reverse.php?lat=" + location[0] + "&lon=" + location[1] + "&format=jsonv2&accept-language=en";

        try {
            let response = await fetch(api);
            let data = await response.json();

            if (!islandMode) {
                let country_code = checkGuessCountryCode(data);
                return country_code.toUpperCase();
            } else if (islandMode) {
                let country_code = checkGuessIslandCode(data);
                return country_code.toUpperCase();
            }
        } catch (err) {
            return 'ERROR';
        }
    }
}

function initializeWorldStats(){
    let subdivised_countries = ["ru", "id", "au", "in", "ca", "mx", "br", "ar", "cl", "za", "de", "bg", "es", "nz", "my", "no", "jp", "nl", "bo", "gb", "pe", "us"];
    let totalCount = 0;
    let totalCorrect = 0;
    let totalGames = 0;
    let totalSeconds = 0;
    let total5ks = 0;
    let near5ks = 0;
    let goodscore = 0;
    let averageScore = 0;
    let averageDistance = 0;
    let averageRoundTime = 0;
    let averageGameTime = 0;

    subdivised_countries.forEach(function(ct){
        if(window.localStorage.getItem(ct+`geostats-overall-standard-stats-${USER_ID}`)){
            let stats = JSON.parse(localStorage.getItem(ct+`geostats-overall-standard-stats-${USER_ID}`));
            totalCount += stats.totalCount;
            totalCorrect += stats.totalCorrect;
            totalGames += stats.totalGames;
            totalSeconds += stats.totalSeconds;
            total5ks += stats.total5ks;
            near5ks += stats.near5ks;
            goodscore += stats.goodscore;
            averageScore += stats.averageScore * stats.totalCount;
            averageDistance += stats.averageDistance * stats.totalCount;
            averageRoundTime += stats.averageRoundTime * stats.totalCount;
            averageGameTime += stats.averageGameTime * stats.totalGames;

        }


    });
    let divisorCount = totalCount;
    let divisorGames = totalGames;
    if(divisorCount == 0){divisorCount = 1};
    if(divisorGames == 0){divisorGames = 1};

    let standardOverallStats = {
        //Total
        totalCount: totalCount,
        totalCorrect: totalCorrect,
        totalGames: totalGames,
        totalSeconds: totalSeconds,
        total5ks: total5ks,
        near5ks: near5ks,
        goodscore: goodscore,

        //Average
        averageScore: averageScore / divisorCount,
        averageDistance: averageDistance / divisorCount,
        averageRoundTime: averageRoundTime / divisorCount,
        averageGameTime: averageGameTime / divisorGames,

        //5k locations:
        all5kLocations: [],
        countryCorrectStreak: 0,
        countryCorrectMax: 0,
        countryWrongStreak: 0,
        countryWrongMax: 0,
    };
    window.localStorage.setItem(`worldgeostats-overall-standard-stats-${USER_ID}`, JSON.stringify(standardOverallStats));
}


//Evaluate The Stats For The Finished Classic Game
function evaluateClassicGameFinished(out) {

    if (out.mode == 'standard') {

        let current_country = window.localStorage.getItem(`subdivisionstats-current-country`);
        let overallStats = JSON.parse(window.localStorage.getItem(`${current_country}geostats-overall-standard-stats-${USER_ID}`));

        overallStats.totalGames++;
        overallStats.totalSeconds += out.player.totalTime;
        overallStats.averageGameTime = ((overallStats.averageGameTime * (overallStats.totalGames - 1)) + out.player.totalTime) / overallStats.totalGames;


        //Save Updated Stats
        window.localStorage.setItem(`${current_country}geostats-overall-standard-stats-${USER_ID}`, JSON.stringify(overallStats));
    }
};

