            let minutesPlayed = Math.floor(Math.floor(overallStats.totalSeconds / 60) % 60);
            let hoursPlayed = Math.floor(overallStats.totalSeconds / 3600);
            document.getElementById('ssstandard-country-stats-total-time-spent-value').innerText = hoursPlayed + 'h ' + minutesPlayed + 'm ';


            //SHOW CORRECT VALUES
            document.getElementById('ssstandard-country-stat-average-score-wrapper').style.display = 'flex';
            document.getElementById('ssstandard-country-stat-average-distance-wrapper').style.display = 'flex';
            document.getElementById('ssstandard-country-stat-average-round-time-wrapper').style.display = 'flex';
