        //Reset Classic Country Scores
        function resetClassicCountryScores(resetId){
            let country = JSON.parse(window.localStorage.getItem(current_country + 'geostats-' + resetId + '-all-standard-stats-${USER_ID}'));
            let overall = JSON.parse(window.localStorage.getItem(current_country + 'geostats-overall-standard-stats-${USER_ID}'));

            //REMOVE FROM OVERALL
            //Average Score
            let overallScore = overall.averageScore * overall.totalCount;
            let countryScore = country.averageScore * country.totalCount;
            overall.averageScore = (overallScore - countryScore) / (overall.totalCount - country.totalCount);

            //Average Distance
            let overallDistance = overall.averageDistance * overall.totalCount;
            let countryDistance = country.averageDistance * country.totalCount;
            overall.averageDistance = (overallDistance - countryDistance) / (overall.totalCount - country.totalCount);

            //Average Round Time
            let overallRoundTime = overall.averageRoundTime * overall.totalCount;
            let countryRoundTime = country.averageRoundTime * country.totalCount;
            overall.averageRoundTime = (overallRoundTime - countryRoundTime) / (overall.totalCount - country.totalCount);

            //Total
            overall.totalCount -= country.totalCount;
            overall.totalCorrect -= country.totalCorrect;
            overall.total5ks -= country.total5ks;
            overall.near5ks -= country.near5ks;
            overall.goodscore -= country.goodscore;
            overall.totalSeconds -= country.totalSeconds;

            //Incorrect Countries
            if(overall.incorrectCountry[resetId]){
                delete overall.incorrectCountry[resetId];
            }

            // Remove country
            window.localStorage.removeItem(current_country + 'geostats-' + resetId + '-all-standard-stats-${USER_ID}');

            //Save overall
            window.localStorage.setItem(current_country + 'geostats-overall-standard-stats-${USER_ID}',JSON.stringify(overall));
        };

        //MAP SLIDER RANGES
        let leftSlider = document.getElementById("ssleft-slider");
        let rightSlider = document.getElementById("ssright-slider");
        let sliderTrack = document.getElementById("ssslider-track");

        let minGap = 1;

        //Change Left Slider Value
        function calcLeftSlider(){
            if(parseInt(rightSlider.value) - parseInt(leftSlider.value) <= minGap){
                leftSlider.value = parseInt(rightSlider.value) - minGap;
            }
            else if(leftSlider.value < 1){
                leftSlider.value = 1;
            }
            document.getElementById('ssleft-slider-output').innerText = leftSlider.value + '%';
            document.getElementById('ssleft-slider-output').style.left = findValue(leftSlider.value);

            fillColor();
            window.localStorage.setItem('ssduels-map-color-left-range-${USER_ID}', leftSlider.value);

        }

        //Change Right Slider Value
        function calcRightSlider(){
            if(parseInt(rightSlider.value) - parseInt(leftSlider.value) <= minGap){
                rightSlider.value = parseInt(leftSlider.value) + minGap;
            }
            else if(rightSlider.value > 99){
                rightSlider.value = 99;
            }
            document.getElementById('ssright-slider-output').innerText = rightSlider.value + '%';
            document.getElementById('ssright-slider-output').style.left = findValue(rightSlider.value);

            fillColor();
            window.localStorage.setItem('ssduels-map-color-right-range-${USER_ID}', rightSlider.value);

        }

        //Fill The Slider With Colors
        function fillColor(){
            let percent1 = parseInt(leftSlider.value);
            let percent2 = parseInt(rightSlider.value);

            sliderTrack.style.background = 'linear-gradient(to right, red 0%, red ' + percent1 + '%, yellow ' + percent1 + '%, yellow ' + percent2 +'%, green ' + percent2 + '%, green 100%)';
        }

        //Put Value Above Slider Thumb
        function findValue(val){
            let valueOne = parseInt(val);
            let valueTwo = valueOne * 0.2;
            let final = 'calc(' + valueOne + '% - ' + valueTwo + 'px)';

            return final;
        }

//Add Event Listeners
document.getElementById("ssleft-slider").addEventListener('input', calcLeftSlider);
document.getElementById("ssright-slider").addEventListener('input', calcRightSlider);
calcLeftSlider();
calcRightSlider();


