function addToggleToStartPage(){

    //Create The Html
    const htmlForToggle = `
        <div id='ssgeostats-standard-game-start-page-toggle-html' style='margin-bottom: 10px'>
            <div class="section_sectionHeader__WQ7Xz section_sizeMedium__yPqLK" style='margin: 20px 0px;'><div class="bars_root___G89E bars_center__vAqnw"><div class="bars_before__xAA7R bars_lengthLong__XyWLx"></div><span class="section_sectionHeader___QLJB section_sizeMedium__CuXRP section_variantLight__G_gsY"><h3>SubdivisionStats Settings</h3></span><div class="bars_after__Z1Rxt bars_lengthLong__XyWLx"></div></div></div>
                <div style="display: flex; justify-content: space-evenly;">
                <span class="game-options_optionLabel__dJ_Cy" style="margin: 0; padding-right: 6px;">Track Stats For This Map</span>
                <input type='checkbox' id='ssgeostats-track-stats-for-this-map-toggle' class='toggle_toggle__qfXpL'>
            </div>
        </div>
    `;

    //Create The Script
    const scriptForToggle = document.createElement('script');
    scriptForToggle.setAttribute('id','ssgeostats-standard-game-start-page-toggle-script');

    scriptForToggle.textContent = `{
        //Check If Toggle Should Be Checked
        let parsedLanguage = "${parsedLanguage}";
        let maps = ${JSON.stringify(country_maps)};
        let currentMapId = window.location.href.replace('https://www.geoguessr.com' + parsedLanguage + '/maps/', '');
        currentMapId = currentMapId.replace('/play', '');

        let temp_maps = JSON.parse(window.localStorage.getItem('subdivisionstats-included-maps-${USER_ID}'));
        temp_maps.forEach(function(temp_map) {
            if (temp_map.includes(currentMapId)) {
                document.getElementById('ssgeostats-track-stats-for-this-map-toggle').checked = true;
                let current_index = temp_maps.indexOf(temp_map);
                current_country = ${JSON.stringify(subdivised_countries)}[current_index];
                window.localStorage.setItem('subdivisionstats-current-country', current_country);
                window.localStorage.setItem('subdivisionstats-current-index', current_index);
            }
        });


        //When The Toggle Changes
        function toggleChange(toggle){
            let currentMapId = window.location.href.replace('https://www.geoguessr.com' + parsedLanguage + '/maps/', '');
            currentMapId = currentMapId.replace('/play', '');
            let maps = JSON.parse(window.localStorage.getItem('subdivisionstats-included-maps-${USER_ID}'));
            let countries_possible = ${JSON.stringify(subdivised_countries)};
            if (toggle.target.checked) {
                const input = prompt('Which country is this map used for? (Choose from: world, ru, id, au, in, ca, mx, br, ar, cl, za, de, bg, es, nz, my, no, jp, nl, bo, gb, pe, us, kz');
                if (countries_possible.includes(input)){
                    map_index = Number(${JSON.stringify(subdivised_countries)}.indexOf(input));
                // Add The Map Id
                let temp_maps = JSON.parse(window.localStorage.getItem('subdivisionstats-included-maps-${USER_ID}'));
                if (!temp_maps[map_index].includes(currentMapId)) {
                    temp_maps[map_index].splice(0, 0, currentMapId);
                    window.localStorage.setItem('subdivisionstats-included-maps-${USER_ID}', JSON.stringify(temp_maps));
                    window.localStorage.setItem('subdivisionstats-current-country', input);
                    window.localStorage.setItem('subdivisionstats-current-index', map_index);
                }
            } else {
                alert("Country unknown");
                document.getElementById('ssgeostats-track-stats-for-this-map-toggle').checked = false;
            }
        } else {
            // Remove The Map Id
            maps.forEach(function (map) {
                if (map.includes(currentMapId)) {
                    const index = map.indexOf(currentMapId);
                    map.splice(index, 1);
                    window.localStorage.setItem('subdivisionstats-included-maps-${USER_ID}' , JSON.stringify(maps));
                }
            });
        }


    }
document.getElementById('ssgeostats-track-stats-for-this-map-toggle').addEventListener('click', toggleChange);
}`;

    //Add Everything To The Page
    //TEST IF THIS WORKS PROPERLY
    if (document.querySelector('.map-selector_selector__RIytg')){

        document.querySelector('.map-selector_selector__RIytg').insertAdjacentHTML('beforeend', htmlForToggle);

        document.getElementById('ssgeostats-standard-game-start-page-toggle-html').appendChild(scriptForToggle);
    }
};

